import { Route } from 'react-router-dom';
import App from './App'
import Home from './components/Home';
import { Switch } from 'react-native/types';

const Routes = () => {
    return (
        <Switch>
            <Route exact path="/" component={App} />
            <Route path="/home" component={Home} />
        </Switch>
    );
};

export default Routes;
